import React, { Component } from 'react'

export default class beach extends Component {
    render() {
        let beach = this.props.beach
        console.log("beach", beach)
        return (
            <div>
                <img id="userbeachphoto" 
                    src={beach.photo_1}
                    alt="no_image_yet">
                    </img> 
            </div>
        )
    }
}
